function getNumberEmoji(number) {
    number = String(number);
    let arrayEmojis = [':zero:', ':one:', ':two:', ':three:', ':four:', ':five:', ':six:', ':seven:', ':eight:', ':nine:'];
    let emoji_number = '';
    let count_numbers = number.length;
    if (count_numbers == 1) {
