Insert Number Options
Obtain Number Emoji
*/
/**
* @param {string} number
*/
function getNumberEmoji(number) {
    number = String(number);
    let arrayEmojis = [':zero:', ':one:', ':two:', ':three:', ':four:', ':five:', ':six:', ':seven:', ':eight:', ':nine:'];
    let emoji_number = '';
    let count_numbers = number.length;
    if (count_numbers == 1) {
        emoji_number = arrayEmojis[number];
    } else {
        let arrayNumber = number.split('');
        for (let key in arrayNumber) {
            emoji_number += arrayEmojis[arrayNumber[key]];
        }
    }
    return emoji_number + ' ';
}

